import React,{useState, useEffect} from "react";

import Title from "../Title";
import Icons from "../I-cons";
import Iconlist from "../IconList";



const icons = [
 { id: 1 , image:"/images/salve-el-planeta.svg", title:"Estudios y proyectos ambientales" },
{id: 2 , image: "/images/laboratorio.svg", title: " Servicios Topográficos y Aerofotogramétricos." },
{id: 3 , image: "/images/la-contaminacion-del-agua.svg", title: "Operación y Mantenimiento de Plantas de Efluentes."},
{id: 4 , image: "/images/laboratorio.svg", title: "Seguridad y Riesgo Industrial."},
{id: 5 , image: "/images/aguas-residuales.svg", title:"Mediciones y Muestreos."},
{id: 6 , image: "/images/sistema.svg", title: "Remediación Ambiental."}
];
function ItemListContainer({ texto }) {
    const [data, setData] = useState([]);

    useEffect(() => {
const getData = new Promise(resolve =>{
    setTimeout(() => {
     resolve(icons);
    },1000);
});
getData.then((res) => setData(res))
    }, [])
    return(
        <>
       < Title greeting= {texto} />
     <Icons/> 
     <Iconlist data={data}/> 
     
        </>
        
    )
}
export default ItemListContainer;
